(68, 1, '2022-04-23 09:59:10', '2022-04-23 09:59:10', 'Optimal investment in Tenerife South for sale in Arona Tenerife. This House has 19 bedrooms, 11 bathrooms.\r\n\r\nNear the sunny coast of the South of Tenerife, surrounded by unique natural landscapes, this 12-hectare plot is a true green paradise. As soon as you pass the portal of the property, a feeling of peace and tranquility invades us. In the midst of exuberant vegetation and banana plantations, there is a group of villas. Six hectares of the farm are dedicated to the cultivation of bananas. 4,000 sqm are buildings. The architecture is a traditional construction from Canary islands built in the 30s. After this an extension for the main house was built and also some more worker houses in the 70s. In its day its main use was for the land exploitation with tomatoes, banana trees and other fruit trees. The villas were used for the accommodation of the land workers, and the storage of material, except for the main house which was the summer house of the owners of the estate. Some of the villas have been fully renovated in 2015 to be used as rural tourism. Nowadays the group of villas is fully inserted in an outdoor banana plantation, as well as by large tree such as laurels and medium size such flamboyants. The abundant presence of Canarian palms as well as other fruit trees such as orange, mango and avocado trees is outstanding. All this gives it an attractive and relaxing environment. Located in a strategic area, this property is only ten minutes from the southern airport and the tourist centre of Playa de las Amricas and five minutes from the highway and the beach.\r\n\r\nThis House for sale has total area of 4,000 m and living area 830 m.\r\n\r\nIf you were looking for House for sale in Arona send us a message below to get more information about this property.\r\n\r\n&nbsp;', 'Optimal Investment 9', '', 'publish', 'open', 'closed', '', 'optimal-investment', '', '', '2022-05-30 14:41:38', '2022-05-30 14:41:38', '', 0, 'http://localhost/RealEstate/?post_type=property&#038;p=68', 0, 'property', '', 0),
